selector_to_html = {"a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Volume Settings<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scan the corresponding setting code to turn on/off the sound prompt of the scanner</p>", "a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 128<a class=\"headerlink\" href=\"#code-128\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id19\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Settings<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Keyboard Language<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>American<a class=\"headerlink\" href=\"#american\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-expanded-rss-expanded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar Expanded (RSS Expanded)<a class=\"headerlink\" href=\"#gs1-databar-expanded-rss-expanded\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id23\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#interleaved-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Interleaved 2 of 5<a class=\"headerlink\" href=\"#interleaved-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id24\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#msi\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI<a class=\"headerlink\" href=\"#msi\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id30\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Get Firmware Version<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id5\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#enable-disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">System Settings<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Auto Sensing Mode<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>In the auto sensing mode, the scanner will detect the brightness of the surrounding environment. When the brightness changes, the scan is triggered. The scan ends when the scan is successful or the scan time exceeds the single working time. Regardless of whether the last scan was successful or failed, the brightness of the surrounding environment will be detected again.</p>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 93<a class=\"headerlink\" href=\"#code-93\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id17\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-limited-rss-limited\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar Limited\uff08RSS Limited\uff09<a class=\"headerlink\" href=\"#gs1-databar-limited-rss-limited\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id21\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Reverse Symbologies<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id12\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#industrial-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Industrial 2 of 5<a class=\"headerlink\" href=\"#industrial-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id27\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Continuous Mode<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>The scanner works continuously. If the scan is successful or the scan time exceeds the single working time, the current scan ends. If the time exceeds the specified time, the next scan is automatically triggered.</p>", "a[href=\"barcode.html#china-post\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">China Post<a class=\"headerlink\" href=\"#china-post\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id29\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 11<a class=\"headerlink\" href=\"#code-11\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id13\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 39<a class=\"headerlink\" href=\"#code-39\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id14\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scan Mode<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Key Trigger Mode<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Press the button to trigger scanning, and release the button to end scanning. Scanning ends when the scan is successful or the reading time exceeds the single reading time.</p>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Transmit Code ID Character<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Link to this heading\">#</a></h2><p>A code ID character identifies the code type of a scanned bar code. This can be useful when decoding more than one code type. The code ID character is inserted between the prefix character (if selected) and the decoded symbol.</p>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Language<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>American<a class=\"headerlink\" href=\"#american\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#gs1-databar-omnidirectional-rss-omnidirectional\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar Omnidirectional\uff08RSS Omnidirectional\uff09<a class=\"headerlink\" href=\"#gs1-databar-omnidirectional-rss-omnidirectional\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id22\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terminator<a class=\"headerlink\" href=\"#terminator\" title=\"Link to this heading\">#</a></h1><h2>End Character Settings<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>The end character is added after the decoded data in the format of decoded data + end character.</p>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Key Trigger Mode<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Press the button to trigger scanning, and release the button to end scanning. Scanning ends when the scan is successful or the reading time exceeds the single reading time.</p>", "a[href=\"scanmode.html#duplicate-barcode-detection-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Duplicate Barcode Detection Settings<a class=\"headerlink\" href=\"#duplicate-barcode-detection-settings\" title=\"Link to this heading\">#</a></h2><h3>Disable<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#matrix-2-of-5\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrix 2 of 5<a class=\"headerlink\" href=\"#matrix-2-of-5\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id28\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">End Character Settings<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>The end character is added after the decoded data in the format of decoded data + end character.</p>", "a[href=\"barcode.html#plessey-telepen\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Plessey/Telepen<a class=\"headerlink\" href=\"#plessey-telepen\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id34\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#nt-6500-wired-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>NT-6500</strong> Wired Scanner Quick Setup Guide<a class=\"headerlink\" href=\"#nt-6500-wired-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id9\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologies<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Reverse Symbologies<a class=\"headerlink\" href=\"#reverse-symbologies\" title=\"Link to this heading\">#</a></h2>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
